import React from 'react-native';
import {HiOutlineMail} from 'react-icons/hi';
import {RiLockPasswordLine} from 'react-icons/ri';
//Para a tela subir junto com o teclado
import {KeyboardAvoidingView, Platform} from 'react-native';
import { 
    Form,
    Screen,
    Content,
    Title,
    Logo,
    Container,
    SubTitle,
    ContainerButton
} from './styles';
import logoImg from '../';
import {Input} from '../../../../components/Input';
import { Button } from '../../../../components/Button';

import {LuUser2 } from "react-icons/lu";
import {HiOutlineIdentification} from "react-icons/hi2";
import {RxCalendar} from "react-icons/rx";
import {MdOutlineMail} from "react-icons/md";
/*import WhiteIcon from '../../../assets/img/white-icon.png';*/



export function SignUpProfessional(){
    return(
   
        <Screen>
        <KeyboardAvoidingView behavior={Platform.OS === 'ios' ? "padding" : undefined}/>
        
        <Content>
        
        <Logo source={logoImg}/>
            <Form>
            <Container>
            <Title> Criar conta </Title>
            <SubTitle> Suas informações: </SubTitle>

            <Input name='nome' placeholder='Nome*' type='primary'/>

            <Input name='cpf' placeholder='CPF*' type='primary' keyboardType='numeric'/>

            <Input name='dataNascimento' placeholder='Data de Nascimento*' type='primary'/>

            <SubTitle> Seu endereço: </SubTitle>

            <Input name='cep' placeholder='CEP*' type='primary' keyboardType='numeric'/>

            <Input name='estado' placeholder='Estado*' type='primary'/>

            <Input name='cidade' placeholder='Cidade*' type='primary'/>

            <Input name='rua' placeholder='Rua*' type='primary'/>

            <Input name='numero 'placeholder='Número*' type='primary'/>

            <Input name='complemento' placeholder='Complemento' type='primary'/>



            <ContainerButton> <Button title='Continuar' type='primary'/> </ContainerButton>

</Container>
            </Form>
            </Content>
        </Screen>
        
    );
}
